import React from "react";
import './web.css';
import projecticon from './pro-icon.png';
import skillsicon from './skill-icon.png'
import eduicon from './edu-icon.png';
import contacticon from './contact-icon.png';
console.log(projecticon);
console.log(contacticon);
console.log(eduicon);
console.log(skillsicon);

function Web() {
    return (
        <div className='web'>
            <div className='web-option'>
                <a href='#skills'>
                <img  className='option-icon' src={skillsicon} width='10' height='10'/>Skills
                </a>
            </div>
            <div className='web-option'>
                <a href='#education'>
                <img  className='option-icon' src={eduicon}/>Education
                </a>
            </div>
            <div className='web-option'>
                <a href='#project'>
                <img  className='option-icon' src={projecticon}/>Projects
                </a>

            </div>

            <div className='web-option'>
                <a href='#contact'>


                </a>
            </div>

        </div>
    )
}

export default Web
